import React from "react";
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import backgroundImage from "../assets/BackgroundImage.png"; // Assuming this is the correct path to your image

const array = ["hola", "hola2", "hola3"];

function Home() {
  return (
    <Box
      sx={{
        backgroundImage: `url(${backgroundImage})`,
        backgroundSize: "cover",
        minHeight: "100vh",
        display: "flex",
        margin:0,
        padding:0,
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <>
        {array.map((element) => {
          return <Button variant="text">{element}</Button>;
        })}

        <Grid container spacing={2}>
          <Grid backgroundColor="red" item xs={8}>
            <Paper sx={{ borderRadius: "25px" }} elevation={5}>
              <Box p={1}>
                <Typography variant="h5">custom border radius</Typography>
              </Box>
            </Paper>
          </Grid>
          <Grid item xs={4}>
            xs=4
          </Grid>
          <Grid item xs={4}>
            xs=4
          </Grid>
          <Grid item xs={8}>
            xs=8
          </Grid>
        </Grid>
      </>
    </Box>
  );
}

export default Home;
